import { useTranslation } from "react-i18next";
import styled from "styled-components";

export const ComponentUserDetail = () => {
    //hooks
    const { t } = useTranslation();
    return (
        <StyledCart>
            <div className="become">{t("page.user_detail.become_member")}</div>
        </StyledCart>
    );
};

const StyledCart = styled.div`
    width: 88%;
    margin: 0 auto;
    padding: 0 24px;
    background-color: #fff;
    box-shadow: rgb(204 204 204) 0px 0px 3px 2px;
    border-radius: 4px;
`;
